import React, { Component } from 'react';

class CourseItem extends Component {
    render() {
        return (
            <div className="rounded btn btn-outline">
                <div className="row">
                    <span>{this.props.name}</span>
                </div>
                <div className="row"><span></span>{this.props.teacher}</div>
            </div>
        );
    }
}

export default CourseItem;
